import React, { Component } from 'react';

import { FiHeart, FiMessageCircle, FiMoreVertical } from 'react-icons/fi';

import './index.css';

class Post extends Component {
	render() {
		return (
			<div className='post'>
				<div className='post-profile'></div>
				<div className='post-info-container'>
					<div className='post-author'>Ariana Grande</div>
					<div className='post-time'>3 HOURS AGO</div>
					<div className='post-in'>In</div>
					<div className='post-location'>42 Silicon Valley</div>
					<div className='post-with'>with</div>
					<div className='post-people'>Luke Kim</div>
				</div>
				<div className='post-picture'></div>
				<div className='post-reflect-container'>
					<FiHeart className='post-icon' />
					<FiMessageCircle className='post-icon' />
					<FiMoreVertical className='post-icon' />
					<div class='post-content'></div>
					<div class='post-likes'>10 likes</div>
					<div class='post-comments'>View all 6 comments</div>
					<div class='post-comment-box' contentEditable='true' data-text='Add a comment...'></div>
					<div class='post-comment-post'>POST</div>
				</div>
			</div>
		);
	}
}

export default Post;
